import gql from "graphql-tag";


export default {
  FETCH_TACOS: gql`
        {
          tacos {
            _id
            name
            description
            rating
            price
            photo
            restaurant {
              _id
              name
              description
            }
          tacoCheckin {
            _id
            name
            restaurant
            description
            rating
          }


          }
        }
      `,

  IS_LOGGED_IN: gql`
    query IsUserLoggedIn {
      isLoggedIn @client
      _id @client
      photo @client
      firstName @client
      lastName @client
    }
  `,

  FETCH_RESTAURANTS: gql`
    {
      restaurants {
        _id
        name
        description
        location
        photo
        tacos {
          _id
          name
        }
        reviews {
          _id
          body
          rating
        }
      }
    }
  `,

  FETCH_RESTAURANT: gql`
    query fetchRestaurant($id: ID!) {
      restaurant(_id: $id) {
        _id
        name
        description
        rating
        location
        facebookLink
        instagram
        photo
        tacos {
          _id
          name
          photo
        }
        reviews {
          _id
          body
          rating
        }
      }
    }
  `,

  FETCH_TACO: gql`
    query fetchTaco($id: ID!) {
      taco(_id: $id) {
        _id
        name
        style
        description
        rating
        price
        photo
        restaurant {
          _id
          name
          location
        }
        tacoCheckin {
          _id
          name
          restaurant
          description
          rating
        }
      }
    }
  `,

  FETCH_REVIEW: gql`
    query fetchReview($id: ID!) {
      review(_id: $id) {
        _id
        body
        rating
        restaurant {
          _id
          name
        }
      }
    }
  `,

  FETCH_REVIEWS: gql`
    {
      reviews {
        _id
        body
        rating
        restaurant {
          _id
          name
        }
      }
    }
  `,

  FETCH_USER: gql`
    query fetchUser($id: ID!) {
      user(_id: $id) {
        _id
        firstName
        lastName
        username
        email
        photo
        tacoCheckin {
          _id
          name
          restaurant
          description
          rating
        }
      }
    }
  `
};
